import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Dropdowns from './Dropdowns.js'
import CharacteristicInput from './CharacteristicInput.js'
import BrandInput from './BrandInput.js'
import '../App.css'
import Form from "react-bootstrap/Form";

class IndexContainer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            characteristicInput: 'ads',
            skinTone: '',
            skinType: '',
            eyeColor: '',
            brandInput: ''
        }
        this.handleChangeCharacteristicInput = this.handleChangeCharacteristicInput.bind(this)
    }

    handleChangeCharacteristicInput(event) {
        this.setState({
            characteristicInput: event.target.value
        });
        console.log('s')
    }

    render() {
        return (
            <Container >
                <Row>
                    <div>
                        <Form>
                            <Form.Group controlId="formBasicEmail">
                                <Form.Control type="string"

                                    // defaultValue={this.props.data}
                                              value={this.state.characteristicInput}
                                              onChange={this.handleChangeCharacteristicInput}

                                              placeholder="Keywords (separated by commas)" />
                                <Form.Text className="text" size="lg">
                                    You can enter anything on your mind from product characteristics (like "moist") to use cases (like "interview")
                                </Form.Text>
                            </Form.Group>
                        </Form>
                    </div>
                </Row>
                <Row>
                    <BrandInput/>
                </Row>
                <Row>
                    <Dropdowns/>
                </Row>
            </Container>
        );
    }
}

export default IndexContainer;
